def namestr(obj, namespace = globals(), n = 0):
    return [name for name in namespace if namespace[name] is obj][n]


def r2h(x):
    red = x[0]
    green = x[1]
    blue = x[2]

    red_percentage= red / float(255)
    green_percentage= green/ float(255)
    blue_percentage=blue / float(255)

    color_hsv_percentage=colorsys.rgb_to_hsv(red_percentage, green_percentage, blue_percentage) 

    color_h=round(360*color_hsv_percentage[0])
    color_s=round(255*color_hsv_percentage[1])
    color_v=round(255*color_hsv_percentage[2])
    color_hsv=(color_h, color_s, color_v)

    return color_hsv



def h2r(x):

    h = x[0]
    s = x[1]
    v = x[2]

    h_percentage = h / float(360)
    s_percentage = s/ float(255)
    v_percentage = v / float(255)
    # s_percentage = 1.0
    # v_percentage = 1.0

    color_rgb_percentage = colorsys.hsv_to_rgb(h_percentage, s_percentage, v_percentage)

    color_r = round(255*color_rgb_percentage[0])
    color_g = round(255*color_rgb_percentage[1])
    color_b = round(255*color_rgb_percentage[2])
    color_rgb = (color_r, color_g, color_b)
    
    return color_rgb

